    <div className='header'>
      <Link to='/'>
      <span className="navbar-brand">
      
          <img id='logoHenry' src={Logo} alt="logo de henry" className="logo" />
      
        <span className='titulo'>Henry weather app</span>
     </span>
     </Link>
